import React, { useState, useEffect } from 'react'
import { useParams } from 'react-router-dom'

const NotePages = () => {
    const { id } = useParams()
    const [note, setNote] = useState()
    useEffect(() => {
    fetch(`/api/notes/${id}`)
    .then(res=>res.json())
    .then(data=>setNote(data))
    }, [])
    console.log(note)
    return (
        <div>NotePage {note.body}</div>
    )
}

export default NotePages
